import React from 'react';
import { Link } from 'react-router-dom';
import PocketPage from './pocket';
import './App.css';


import FullCalendar from '@fullcalendar/react';
import dayGridPlugin from '@fullcalendar/daygrid';
import timeGridPlugin from '@fullcalendar/timegrid';
import interactionPlugin from '@fullcalendar/interaction';

function App() {

  return (
    <div className="App">
      <div className="main-title" ><a href ="">DoTory üêø</a></div>

      <nav>
        <ul className="nav-container">
        <Router>
          <li className = "nav-item"><Link to="/">Checklist</Link></li>
          <li className = "nav-item"><Link to="/">Diary</Link></li>
          <li className = "nav-item"><Link to="/PocketPage">Pocket</Link></li>
        </Router>
        </ul>
      </nav>

      <div>
      <FullCalendar className="main-calendar"
        plugins={[dayGridPlugin, timeGridPlugin, interactionPlugin]}
        initialView="dayGridMonth"
      />
    </div>

    </div>
  );
}

export default App;
